import React, { useEffect, useState } from 'react';
import { fetchDataFromBackend } from '../utils/api';
import PerformanceChart from './PerformanceChart';
import PerformanceSummary from './PerformanceSummary';

function WeeklyPerformance() {
  const [weeklyData, setWeeklyData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const data = await fetchDataFromBackend('/performance/weekly');
      setWeeklyData(data);
    };

    fetchData();
  }, []);

  return (
    <div className="weekly-performance">
      <h2>Weekly Performance</h2>
      <PerformanceChart data={weeklyData} />
      <PerformanceSummary data={weeklyData} />
    </div>
  );
}

export default WeeklyPerformance;
